package aula20;

public class Calculo implements Adicao, Multiplicao {

	@Override
	public int multiplicar(int a, int b) {
		// TODO Auto-generated method stub
		return a * b;
	}

	@Override
	public int somar(int a, int b) {
		// TODO Auto-generated method stub
		return a + b;
	}
	
	

}
